import { Fragment } from "react";
import MealSummary from "./MealSummary";
import MealList from "./MealList";
import { Menu } from "../Menu/Menu";
import Card from "../UI/Card";

const Meals = () => {
    return (
        <Fragment>
            <MealSummary />
            <Card>
            <Menu/>
            <MealList/>
            </Card>
      </Fragment>  
    );
}

export default Meals;
